import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav class="invisible-navbar">
        <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#poject">Project</a></li>
            <li><a href="#contact">Contact</a></li>
        </ul>
    </nav>
    
    <div class="content">
    <div id="home">this is portfolio website</div>
    <div id="about" >About Section</div>
    <div id="poject">Project</div>
    <div id="contact">Contact Section</div>
    </div>
    </div>
  );
}

export default App;
